import "./App.css";
import Home from "./pages/Home";
import { BrowserStack, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserStack>
        <Route path="/">
          <Home />
        </Route>
      </BrowserStack>
    </div>
  );
}

export default App;
